, "teacher_position": {"id": 3, "name": "Доцент", "created_at": "2022-03-31T14:00:02.000000Z", "updated_at": "2022-03-31T14:00:02.000000Z", "abbreviated": "доцент"}, "conferences_count": 432, "dissertation_proof": "14.08.2008г. на кафедре высшей математики Универсального института инновационных технологий города Москвы защитила диссертацию на соискание ученой степени кандидата на тему «Риски и пути минимизации в деятельности коммерческих банков» по специальности «Экономика и управление народным хозяйством» (08.00.05)", "education_level_id": 1, "publications_count": 5432, "proof_document_link": "some_link", "teacher_position_id": 3, "diploma_projects_count": 345, "professional_interests": "Профессиональные и научные интересы:\\r\\n                Разнообразный и богатый опыт укрепление и развитие структуры требуют от нас анализа модели развития. Повседневная практика показывает, что постоянный количественный рост и сфера нашей активности позволяет выполнять важные задания по разработке позиций, занимаемых участниками в отношении поставленных задач.\\r\\n                Не следует, однако забывать, что начало повседневной работы по формированию позиции требуют от нас анализа позиций, занимаемых участниками в отношении поставленных задач. Идейные соображения высшего порядка, а также реализация намеченных плановых заданий позволяет оценить значение дальнейших направлений развития. Таким образом сложившаяся структура организации в значительной степени обуславливает создание новых предложений. Разнообразный и богатый опыт дальнейшее развитие различных форм деятельности требуют определения и уточнения новых предложений."}, "audience": {"id": 1, "name": "30", "capacity": 12, "created_at": "2022-03-31T14:00:02.000000Z", "updated_at": "2022-03-31T14:00:02.000000Z"}, "study_process": {"id": 1, "name": "дистанционное обучение", "created_at": "2022-03-31T14:00:02.000000Z", "updated_at": "2022-03-31T14:00:02.000000Z"}}]','deleted_at' => NULL,'deletion_author_id' => NULL,'created_at' => '2022-03-31 17:59:10','updated_at' => '2022-03-31 17:59:10'),
